import React from 'react';

function Component2() {
    return (
        <>
            <div className="container text-center">
                <div className="row p-5">
                    <h1 className='fs-2 mt-5'>Visualize Your Journey</h1>
                    <p className='fs-6 mt-2'>See your habits come together in a beautiful, GitHub-inspired visualization. Track multiple habits at once and pin your most important ones for quick access and focused tracking.</p>
                    <button className='btn btn-lg home-btn1' style={{width:"200px" ,height:"45px"}}>Start Your Journey</button>
                </div>
            </div>
        </>
    );
}

export default Component2;
